Car.create(user_id: 1, model: 'DB5',                  year: 1964,  brand: 'The Aston Martin',          price: 190, features: Faker::Vehicle.standard_specs,  color: 'grey',      location: 'NW3 7RR', description: 'Name dropped in the James Bond franchise as well as elsewhere in popular culture, its sky-high price has grown an estimated 790 times since it first arrived on the market. Conceptualized by the Italian designer Carrozzeria Touring Superleggera in Milan, this cool old car was always designed to make an entrance. The more time passes, the bigger the entrance promises to be.' ,                                                                                                 photo_url: 'https://cdn.luxe.digital/media/2021/11/26104812/best-classic-cars-vintage-Aston-Martin-DB5-1964-old-luxe-digital%402x.jpg.webp')
Car.create(user_id: 2, model: 'E-Type',               year: 1961,  brand: 'Jaguar',                    price: 150, features: Faker::Vehicle.standard_specs , color: 'dark grey', location: 'SW9 8GA', description: 'Enzo Ferrari described the Jaguar as the most beautiful car in the world and we’d be hard-pressed to disagree. Many of Jaguar’s future designs were inspired by the E-Type, from the body shape to the internal mechanisms and everything in between. It’s a classic car with a legacy that’s lived on arguably further than any other Jaguar in existence.' ,                                                                                                                            photo_url: 'https://cdn.luxe.digital/media/2021/11/26104913/best-classic-cars-vintage-Jaguar-E-Type-1961-old-luxe-digital%402x.jpg.webp')
Car.create(user_id: 3, model: '911',                  year: 1963 , brand: 'Porsche',                   price: 250, features: Faker::Vehicle.standard_specs , color: 'grey',      location: 'SE14 5QG', description: 'The design of this luxury supercar actually stemmed from the Volkswagen Beetle, as both were designed by the same person: Ferdinand Porsche. And, even nowadays, the 911 continues to take the record of being the most popular classic sports car in the world. All of those cars have all been produced in the same factory, in Stuttgart, Germany.',                                                                                                                                   photo_url: 'https://cdn.luxe.digital/media/2021/11/26104949/best-classic-cars-vintage-Porsche-911-1963-old-luxe-digital%402x.jpg.webp')
Car.create(user_id: 4, model: 'El Camino SS',         year: 1970 , brand: 'Chevrolet',                 price: 260, features: Faker::Vehicle.standard_specs , color: 'blue',      location: 'NW1 9HA', description: 'Think of old-time American movies and you’ll probably find a vague image of a 1970 Chevrolet El Camino SS springs to mind. This American classic was a national and international icon even before the years passed and it turned into a classic car rather than an everyday vehicle.',                                                                                                                                                                                                   photo_url: 'https://cdn.luxe.digital/media/2021/11/26104836/best-classic-cars-vintage-Chevrolet-El-Camino-SS-1970-old-luxe-digital%402x.jpg.webp')
Car.create(user_id: 1, model: 'Starfire Convertible', year: 1962 , brand: 'Oldsmobile',                price: 220, features: Faker::Vehicle.standard_specs , color: 'blue',      location: 'SE15 3RU', description: 'The 1962 Oldsmobile Starfire Convertible was the pride and joy of General Motors when it was first released in 1960. It quickly rose to fame as one of the brand’s best-selling models, with its ubiquitous open top and sleek and stylish design.' ,                                                                                                                                                                                                                                     photo_url: 'https://cdn.luxe.digital/media/2021/11/26104943/best-classic-cars-vintage-Oldsmobile-Starfire-Convertible-1962-old-luxe-digital%402x.jpg.webp')
Car.create(user_id: 2, model: 'Mini',                 year: 1959 , brand: 'British Motor Corporation', price: 160, features: Faker::Vehicle.standard_specs , color: 'red',       location: 'E11 9GZ', description: 'There’s no classic car quite like the classic Mini. Modernized time and time again with new colors and features, this is the classic car you’re most likely to still see in action in the 21st century. Shortly after its initial release, the Mini quickly became one of the most popular classic cars of all time.',                                                                                                                                                                    photo_url: 'https://cdn.luxe.digital/media/2021/11/26104822/best-classic-cars-vintage-British-Motor-Corporation-Mini-1959-old-luxe-digital%402x.jpg.webp')
Car.create(user_id: 3, model: '250 GTO',              year: 1962,  brand: 'Ferrari ',                  price: 120, features: Faker::Vehicle.standard_specs , color: 'red',       location: 'SE15 2NB', description: 'The sleek, stylish Ferrari 250 GTO is one of the most famous classic cars of all time and for a very good reason. This one-of-a-kind model sits worlds apart from the rest, both in its modernized design and expensive price tag (just like the world’s most expensive cars).' ,                                                                                                                                                                                                         photo_url: 'https://cdn.luxe.digital/media/2021/11/26104851/best-classic-cars-vintage-Ferrari-250-GTO-1962-old-luxe-digital%402x.jpg.webp')
Car.create(user_id: 4, model: 'Mustang Shelby GT350', year: 1965,  brand: 'Ford',                      price: 200, features: Faker::Vehicle.standard_specs , color: 'white',     location: 'N11 3LA', description: 'The Shelby Mustang was designed to look good and to drive fast. It wasn’t specially designed for comfort, and it definitely wasn’t designed for family days out. But at least it excelled in the area it originally chose. This stylish, high-performance classic car came in plenty of different variations, with edits made over the years to encourage faster speeds (well, just not quite like the fastest cars in the world), cooler designs, and everything in-between.' ,          photo_url: 'https://cdn.luxe.digital/media/2021/11/26104902/best-classic-cars-vintage-Ford-Mustang-Shelby-GT350-1965-old-luxe-digital%402x.jpg.webp')
Car.create(user_id: 1, model: '300SL Gullwing',       year: 1954,  brand: 'Mercedes',                  price: 300, features: Faker::Vehicle.standard_specs , color: 'silver',    location: 'SW11 3UE', description: 'Mention the Mercedes 300SL Gullwing 1954 and you’ll undoubtedly see ears prick up, especially if you’re in a circle of classic car fans. One of the most stylish and iconic classic cars in the world, the Gullwing firmly cemented its place as a premium offering as soon as it launched. ' ,                                                                                                                                                                                           photo_url: 'https://cdn.luxe.digital/media/2021/11/26104932/best-classic-cars-vintage-Mercedes-300SL-Gullwing-1954-old-luxe-digital%402x.jpg.webp')
Car.create(user_id: 2, model: 'Corvette',            year: 1963,  brand: 'Chevrolet',                 price: 180, features: Faker::Vehicle.standard_specs , color: 'dark blue', location: 'E15 1AJ', description: 'The Chevrolet Corvette 1963 was a rare car even when it was first released, which means sourcing a journey in one of these nowadays—let alone even trying to buy one—is an adventure in itself. This famous American muscle car was known best for its “split-window coupe”, offering a unique perspective both from the inside and the outside. ' ,                                                                                                                                      photo_url: 'https://cdn.luxe.digital/media/2021/11/26104831/best-classic-cars-vintage-Chevrolet-Corvette-1963-old-luxe-digital%402x.jpg.webp')
Car.create(user_id: 3, model: 'Type 57 Atlantic',    year: 1938,  brand: 'Bugatti',                   price: 240, features: Faker::Vehicle.standard_specs , color: 'black',     location: 'E2 7LF', description: 'Thought an older Bugatti might be more budget-friendly than a recent model? Think again. You need no better proof that the 1938 Bugatti Type 57 Atlantic will ever go out of fashion than by the knowledge that Ralph Lauren owns the very last one to ever be produced. First created as an entirely new design by Jean Bugatti, there were only ever 710 of these models produced.',                                                                                                    photo_url: 'https://cdn.luxe.digital/media/2021/11/26104827/best-classic-cars-vintage-Bugatti-Type-57-Atlantic-1938-old-luxe-digital%402x.jpg.webp')
Car.create(user_id: 4, model: 'Dawn Drophead',       year: 1949,  brand: 'Rolls-Royce',               price: 270, features: Faker::Vehicle.standard_specs , color: 'blue',      location: 'E14 2XG', description: 'The 1949 Rolls-Royce Dawn Drophead was originally sold after the war, in an effort to redefine luxury and bring back the heightened levels of comfort from before. While it quickly rose to popularity, it was noted for a few peculiar features including a lack of seatbelts and an engine that doesn’t actually fire. ' ,                                                                                                                                                              photo_url: 'https://cdn.luxe.digital/media/2021/11/26104954/best-classic-cars-vintage-Rolls-Royce-Dawn-Drophead-1949-old-luxe-digital%402x.jpg.webp')
Car.create(user_id: 1, model: 'XJS',                 year: 1989,  brand: 'Jaguar',                    price: 100, features: Faker::Vehicle.standard_specs , color: 'black',     location: 'E5 9GA', description: 'An unbreakable passion for adventure: that’s what you’ll be reminded of as soon as you’ve made yourself comfortable behind the wheel of a 1989 Jaguar XJS. A classic car made for fun days out and spontaneous decisions, this car is one that kept itself remarkably together and refused to ever break down.' ,                                                                                                                                                                         photo_url: 'https://cdn.luxe.digital/media/2021/11/26104918/best-classic-cars-vintage-Jaguar-XJS-1989-old-luxe-digital%402x.jpg.webp')
Car.create(user_id: 2, model: 'Viper',               year: 1991,  brand: 'Dodge',                     price: 230, features: Faker::Vehicle.standard_specs , color: 'red',       location: 'W5 4LU', description: 'The Dodge Viper takes things a little further than your standard classic car in pretty much every way—from speed to sleek design, to almost all other capabilities. This new classic car comes with a love/hate relationship, with some adoring it for its tenacity and others dismissing it as a loose cannon.' ,                                                                                                                                                                        photo_url: 'https://cdn.luxe.digital/media/2021/11/26104846/best-classic-cars-vintage-Dodge-Viper-1991-old-luxe-digital%402x.jpg.webp')
Car.create(user_id: 3, model: 'CSL',                 year: 1972,  brand: 'BMW',                       price: 260, features: Faker::Vehicle.standard_specs , color: 'black',     location: 'E1 8EW', description: 'Take a quick look at the BMW 3.0 CSL and you might be reminded of another famous vehicle: the Batmobile. Designed to be just as happy driving on racetrack or road, this beast of a car came in limited numbers and only 1,265 have ever been produced. ' ,                                                                                                                                                                                                                               photo_url: 'https://cdn.luxe.digital/media/2021/11/26104817/best-classic-cars-vintage-BMW-CSL-1972-old-luxe-digital%402x.jpg.webp')
Car.create(user_id: 4, model: 'Pantera',             year: 1970,  brand: 'De Tomaso Automobili',      price: 210, features: Faker::Vehicle.standard_specs , color: 'black',     location: 'E1 2BA', description: 'The DeTomaso Pantera fused together two of the best parts of the car industry: that sleek, ubiquitous Italian design and the sturdy, unbreakable mechanics from the United States. Marry the two, and you’ll find yourself with a Pantera, or “Panther”.' ,                                                                                                                                                                                                                               photo_url: 'https://cdn.luxe.digital/media/2021/11/26104841/best-classic-cars-vintage-De-Tomaso-Pantera-1970-old-luxe-digital%402x.jpg.webp')
Car.create(user_id: 1, model: 'Miura',               year: 1966,  brand: 'Lamborghini',               price: 150, features: Faker::Vehicle.standard_specs , color: 'green',     location: 'N15 5AL', description: 'Its name comes from that of a particularly ferocious Spanish fighting bull, thought to represent the car’s tenacity and speed. This cool old car is one that’s had more than a few adjustments over the years, all released in a range of vibrant and personality-filled colors.' ,                                                                                                                                                                                                       photo_url: 'https://cdn.luxe.digital/media/2021/11/26104922/best-classic-cars-vintage-Lamborghini-Miura-1966-old-luxe-digital%402x.jpg.webp')
Car.create(user_id: 2, model: 'Beetle',              year: 1938,  brand: 'Volkswagen',                price: 190, features: Faker::Vehicle.standard_specs , color: 'green',     location: 'E3 3DJ', description: 'Volkswagen’s most iconic car is definitely the Beetle, first designed in 1925 by a Hungarian student and applauded for its lightweight design. While most competing cars at the time were known for being heavy and difficult to drive, the Beetle was lightweight and free, a joy to drive for anyone who sat behind the wheel.' ,                                                                                                                                                       photo_url: 'https://cdn.luxe.digital/media/2021/11/26104959/best-classic-cars-vintage-Volkswagen-Beetle-1938-old-luxe-digital%402x.jpg.webp')
Car.create(user_id: 3, model: 'Model T',             year: 1908,  brand: 'Ford',                      price: 300, features: Faker::Vehicle.standard_specs , color: 'black',     location: 'SE28 8BT', description: 'The Ford Model T 1908 is such a classic car, it not only has its own car-focused history pages but also rightfully owns a place in more generalised history features. Sold by the Ford Motor Company from 1908 to 1927, the Ford Model T was the first car available to the public to buy, in the famous “any colour as long as it’s black” model. ' ,                                                                                                                                    photo_url: 'https://cdn.luxe.digital/media/2021/11/26104856/best-classic-cars-vintage-Ford-Model-T-1908-old-luxe-digital%402x.jpg.webp')
Car.create(user_id: 4, model: 'Chevy Corvette',      year: 1963,  brand: 'Chevrolet',                 price: 160, features: Faker::Vehicle.standard_specs , color: 'orange',    location: 'E16 4LA', description: 'The emblem of Big Three muscle cars, the Chevy Corvette is the most collected vehicle in America.' ,                                                                                                                                                                                                                                                                                                                                                                                      photo_url: 'https://hips.hearstapps.com/toc.h-cdn.co/assets/16/14/2560x1906/1968-chevrolet-corvette_1.jpg?resize=768:*')
Car.create(user_id: 1, model: 'Miura',               year: 1966,  brand: 'Lamborghini',               price: 270, features: Faker::Vehicle.standard_specs , color: 'green',     location: 'SW6 7EU', description: 'Considered by some to be the sexiest car ever built, the Miura debuted in 1966 as a sleek mid-engine speedster designed to challenge Ferrari.' ,                                                                                                                                                                                                                                                                                                                                          photo_url: 'https://hips.hearstapps.com/toc.h-cdn.co/assets/16/14/3200x2136/1971-lamborghini-miura-sv_1.jpg?resize=768:*')

